import React from 'react'
import Navbar from '../../common/Navbar/Navbar';
import "./Industries.css"

const Industries = () => {
    return (
        <>
            <>
                <header>
                    <div className="container">
                        {/* NAVBAR*/}
                        <Navbar navTheme = {'Theme'}/>
                        {/*/.END NAVBAR*/}
                    </div>
                </header>
            </>

        </>
    )
}

export default Industries;
